use crate::util::Hyperbridge;
use codec::Decode;
use divide_range::RangeDivisions;
use ethers::abi::AbiDecode;
use hex_literal::hex;
use ismp::{
	host::StateMachine,
	messaging::{hash_request, Keccak256},
	router::{PostRequest, Request},
};
use ismp_solidity_abi::handler::HandlePostRequestsCall;
use merkle_mountain_range::{leaf_index_to_mmr_size, leaf_index_to_pos, util::MemMMR, MerkleProof};
use mmr_primitives::DataOrHash;
use pallet_ismp::mmr::{Leaf, Proof as MmrProof};
use primitive_types::H256;
use sp_core::Bytes;
use sp_mmr_primitives::utils::NodesUtils;
use sp_runtime::traits::Keccak256 as KeccakHasher;
use substrate_state_machine::HashAlgorithm;
use subxt::{
	ext::{sp_core, sp_core::keccak_256},
	rpc_params,
};
use tesseract_primitives::{IsmpProvider, Query};
use tesseract_substrate::{SubstrateClient, SubstrateConfig};

pub struct Hasher;

impl Keccak256 for Hasher {
	fn keccak256(bytes: &[u8]) -> H256 {
		keccak_256(bytes).into()
	}
}

pub type Mmr = MemMMR<DataOrHash<KeccakHasher, Leaf>, pallet_mmr::mmr::Hasher<KeccakHasher, Leaf>>;

#[tokio::test]
#[ignore]
async fn extract_mmr_leaves() {
	let substrate_config = SubstrateConfig {
		state_machine: StateMachine::Kusama(4009),
		hashing: Some(HashAlgorithm::Keccak),
		consensus_state_id: Some("PARA".to_string()),
		max_rpc_payload_size: None,
		// rpc_ws: "wss://hyperbridge-paseo-rpc.blockops.network:443".to_string(),
		rpc_ws: "ws://127.0.0.1:9901".to_string(),
		signer: Some(
			"0xe5be9a5092b81bca64be81d212e7f2f9eba183bb7a90954f7b76361f6edb5c0a".to_string(),
		),
		latest_height: None,
		max_concurent_queries: None,
	};

	let prefix = sp_mmr_primitives::INDEXING_PREFIX;

	let hyperbridge = SubstrateClient::<Hyperbridge>::new(substrate_config).await.unwrap();
	println!("Initialized hyperbridge client");

	let bytes = hex!("");

	let message = HandlePostRequestsCall::decode(&bytes).unwrap().request;
	let leaf_count = message.proof.leaf_count.low_u64();
	dbg!(leaf_count);
	let offchain_key = |pos: u64| NodesUtils::node_canon_offchain_key(&prefix[..], pos);

	let mut mmr = Mmr::default();

	let chunks = (0..leaf_count).divide_evenly_into(256);
	let mut futures = vec![];
	for chunk in chunks {
		let future = async {
			let mut leaves = vec![];
			for i in chunk {
				let pos = leaf_index_to_pos(i);
				let key = offchain_key(pos);
				let params =
					rpc_params![sp_core::offchain::StorageKind::PERSISTENT, hex::encode(key)];
				let encoded: Bytes = hyperbridge
					.client
					.rpc()
					.request::<Option<Bytes>>("offchain_localStorageGet", params)
					.await
					.expect("Data should be present")
					.unwrap();
				let leaf = DataOrHash::<KeccakHasher, Leaf>::decode(&mut &*encoded.0).unwrap();
				leaves.push(leaf);
			}
			leaves
		};

		futures.push(future);
	}

	let leaves = futures::future::join_all(futures)
		.await
		.into_iter()
		.flatten()
		.collect::<Vec<_>>();

	for leaf in leaves.clone() {
		mmr.push(leaf).expect("Failed to push leaf to mmr");
	}

	let size = leaf_index_to_mmr_size(leaf_count - 1);

	let mut evm_leaves = vec![];
	let mut claimed_indices = vec![];
	let mut actual_leaves = vec![];

	for l in message.requests.clone() {
		let hyerbridge_leaf = match &leaves[l.index.low_u64() as usize] {
			DataOrHash::<KeccakHasher, Leaf>::Data(Leaf::Request(Request::Post(post))) =>
				post.clone(),
			value => panic!("Unexpected value {value:?}"),
		};
		actual_leaves.push(hyerbridge_leaf);
		let evm_leaf: PostRequest = l.request.try_into().unwrap();

		evm_leaves.push(evm_leaf);
		claimed_indices.push(l.index.low_u64() as usize);
	}

	let evm_hashes = evm_leaves
		.clone()
		.into_iter()
		.map(|post| hash_request::<Hasher>(&Request::Post(post)))
		.collect::<Vec<_>>();
	let hyperbridge_hashes = actual_leaves
		.clone()
		.into_iter()
		.map(|post| hash_request::<Hasher>(&Request::Post(post)))
		.collect::<Vec<_>>();

	// println!("EVM: {evm_hashes:?}");

	// println!("Hyperbridge: {hyperbridge_hashes:?}");

	assert_eq!(evm_hashes, hyperbridge_hashes);

	let correct_indices = evm_leaves
		.iter()
		.enumerate()
		.filter_map(|(_i, leaf)| {
			leaves.iter().position(|l| match l {
				DataOrHash::Data(Leaf::Request(Request::Post(post))) if post == leaf => true,
				_ => false,
			})
		})
		.collect::<Vec<_>>();

	let leaves = message
		.requests
		.into_iter()
		.zip(correct_indices)
		.map(|(l, i)| (leaf_index_to_pos(i as u64), l.request.try_into()))
		.filter_map(|(pos, r)| {
			if let Ok(req) = r {
				Some((pos, DataOrHash::Hash(hash_request::<Hasher>(&Request::Post(req)))))
			} else {
				None
			}
		})
		.collect::<Vec<_>>();

	// assert_eq!(call_leaves, leaves);

	let proof = message
		.proof
		.multiproof
		.iter()
		.map(|h256| DataOrHash::Hash(H256(h256.clone())))
		.collect();
	let proof = MerkleProof::<_, pallet_mmr::mmr::Hasher<KeccakHasher, Leaf>>::new(size, proof);
	dbg!(proof.calculate_root(leaves.clone()).unwrap());

	let actual_leaves_hashes = actual_leaves
		.clone()
		.into_iter()
		.zip(claimed_indices)
		.map(|(l, i)| {
			(
				leaf_index_to_pos(i as u64),
				DataOrHash::Hash(hash_request::<Hasher>(&Request::Post(l))),
			)
		})
		.collect::<Vec<_>>();

	dbg!(proof.calculate_root(actual_leaves_hashes).unwrap());

	dbg!(mmr.get_root().unwrap());

	let mmr_proof = mmr.gen_proof(leaves.into_iter().map(|(pos, ..)| pos).collect()).unwrap();

	// assert_eq!(proof.proof_items(), mmr_proof.proof_items());

	let raw_proof = hyperbridge
		.query_requests_proof(
			94928,
			evm_hashes
				.into_iter()
				.map(|hash| Query {
					source_chain: StateMachine::Evm(97),
					dest_chain: StateMachine::Evm(11155420),
					commitment: hash,
					nonce: 0,
				})
				.collect(),
		)
		.await
		.unwrap();

	let rpc_mmr_proof = MmrProof::<H256>::decode(&mut &*raw_proof).unwrap();

	for ((a, b), c) in proof
		.proof_items()
		.into_iter()
		.zip(mmr_proof.proof_items())
		.zip(rpc_mmr_proof.items)
	{
		println!("{a:?},     {b:?}   {c:?}");
	}

	evm_leaves.sort_by(|a, b| a.nonce.cmp(&b.nonce));
	actual_leaves.sort_by(|a, b| a.nonce.cmp(&b.nonce));

	// assert_eq!(actual_leaves, evm_leaves);
}
